import "./Home.css"
import blog from './res/images/blog.svg';


export default function Home(){
    return(
        <div id="home">
            <div id="Group-6">
                
                <h1>CampaignVault</h1>
                <h2>Uma ferramenta que promete te deixar rico</h2>
                
            </div>
            <div id="Group-7">
            width: 320.63px;
height: 28px;
top: 62.62px;
left: 69px;
padding: 0px;
gap: 0px;
opacity: 0px;

            </div>
            <div id="blog">
                <img alt="blogSVG" id='blogSVG' src={blog}/>
            </div>
        </div>
    )
}
